<script>
// 验证关键技术点
// 模型预览√
// 图片插入√（插入模型预览快照）
// 模型下载，手动拖入√
// 文档下载编辑-
// 编辑后上传-
export default {
  name: 'HelloWorld',
  props: {
    msg: String
  },
  methods: {
    uploadDocument() {
      // Create a function for writing to the status div.
      function updateStatus(message) {
        console.log(message)
      }
      // Get all of the content from a PowerPoint or Word document in 100-KB chunks of text.
      //modify to 4MB (max)
      function sendFile() {
        window.Office.context.document.getFileAsync("compressed",
          { sliceSize: 4194304 },
          function (result) {

            if (result.status === window.Office.AsyncResultStatus.Succeeded) {

              // Get the File object from the result.
              var myFile = result.value;
              var state = {
                file: myFile,
                counter: 0,
                sliceCount: myFile.sliceCount
              };
              console.log("File size:" + myFile.size + " #Slices: " + myFile.sliceCount)

              updateStatus("Getting file of " + myFile.size + " bytes");
              getSlice(state);
            } else {
              updateStatus(result.status);
            }
          });
      }
      // Get a slice from the file and then call sendSlice.
      function getSlice(state) {
        state.file.getSliceAsync(state.counter, function (result) {
          if (result.status == window.Office.AsyncResultStatus.Succeeded) {
            updateStatus("Sending piece " + (state.counter + 1) + " of " + state.sliceCount);
            sendSlice(result.value, state);
          } else {
            updateStatus(result.status);
          }
        });
      }
      function myEncodeBase64(data) {
        const binString = Array.from(data, (x) => String.fromCodePoint(x)).join("");
        return binString
      }
      //make uuid
      function makeUuid() {
        var temp_url = URL.createObjectURL(new Blob());
        var uuid = temp_url.toString(); // blob:https://xxx.com/b250d159-e1b6-4a87-9002-885d90033be3
        URL.revokeObjectURL(temp_url);
        return uuid.substr(uuid.lastIndexOf("/") + 1);
      }

      function sendSlice(slice, state) {
        var data = slice.data;

        // If the slice contains data, create an HTTP request.
        if (data) {

          // Encode the slice data, a byte array, as a Base64 string.
          // NOTE: The implementation of myEncodeBase64(input) function isn't
          // included with this example. For information about Base64 encoding with
          // JavaScript, see https://developer.mozilla.org/docs/Web/JavaScript/Base64_encoding_and_decoding.
          var fileData = myEncodeBase64(data);

          // Create a new HTTP request. You need to send the request
          // to a webpage that can receive a post.
          var request = new XMLHttpRequest();

          // Create a handler function to update the status
          // when the request has been sent.
          request.onreadystatechange = function () {
            if (request.readyState == 4) {

              updateStatus("Sent " + slice.size + " bytes.");
              state.counter++;

              if (state.counter < state.sliceCount) {
                getSlice(state);
              } else {
                closeFile(state);
              }
            }
          }

          request.open("POST", "https://dzxx.njcit.owvlab.net/rich_editor/document/upload/uploadchunk");
          request.setRequestHeader("Slice-Number", slice.index);
          request.setRequestHeader("UUID", uuid);
          request.setRequestHeader("total-count", state.sliceCount);

          // Send the file as the body of an HTTP POST
          // request to the web server.
          request.send(fileData);
        }
      }
      function closeFile(state) {
        // Close the file when you're done with it.
        state.file.closeAsync(function (result) {

          // If the result returns as a success, the
          // file has been successfully closed.
          if (result.status === window.Office.AsyncResultStatus.Succeeded) {
            updateStatus("File closed.");
          } else {
            updateStatus("File couldn't be closed.");
          }
        });
      }

      let uuid = makeUuid();
      sendFile();
    },
    alertModel() {
      window.Office.context.ui.displayDialogAsync(
        "https://localhost:3000/static/plugins/x3DV/website/index.html#model=https://dzxx.njcit.owvlab.net/vlab_files/2022/219/0982/4gfc.fbx",
        { height: 60, width: 55 },
        null)
    },
    importFile() {
      this.$refs.inputFile.dispatchEvent(new MouseEvent('click'))
    },
    insertImg() {
      //       function getImageAsBase64String() {
      //   // A production add-in code could get an image from an
      //   // online source and pass it to a library function that
      //   // converts to base 64.
      //   return "";
      // }
      function urlToBase64(imageUrl, callback, outputFormat) {
        // return getImageAsBase64String(imageUrl)

        // return new Promise((resolve, reject) => {
        //   let canvas = document.createElement('canvas')
        //   const ctx = canvas.getContext('2d')
        //   let img = new Image()
        //   img.crossOrigin = 'Anonymous' // 解决Canvas.toDataURL 图片跨域问题
        //   img.src = imageUrl
        //   img.onload = function () {
        //     canvas.height = img.height
        //     canvas.width = img.width
        //     ctx.fillStyle = '#fff' // canvas背景填充颜色默认为黑色
        //     ctx.fillRect(0, 0, img.width, img.height)
        //     ctx.drawImage(img, 0, 0) // 参数可自定义
        //     const dataURL = canvas.toDataURL('image/png', 1) // 获取Base64编码
        //     resolve(dataURL)
        //     canvas = null // 清除canvas元素
        //     img = null // 清除img元素
        //   }
        //   img.onerror = function () {
        //     reject(new Error('Could not load image at ' + imageUrl))
        //   }
        // })
        var canvas = document.createElement('CANVAS')
        var ctx = canvas.getContext('2d')
        var img = new Image()
        img.crossOrigin = 'Anonymous'
        img.src = imageUrl
        img.onload = function () {
          canvas.height = img.height
          canvas.width = img.width
          ctx.drawImage(img, 0, 0)
          var dataURL = canvas.toDataURL(outputFormat || 'image/png')
          //回调函数传递转换完成的base64编码
          callback.call(this, dataURL)
          canvas = null
        }
      }

      urlToBase64("https://localhost:3000/static/img/snip.png", function (dataURL) {
        console.log(dataURL)
        //切除信息：`data:image/png;base64,`
        var spbs = dataURL.split(",")
        window.Office.context.document.setSelectedDataAsync(spbs[1],
          {
            coercionType: window.Office.CoercionType.Image,
            // imageLeft: 50,
            // imageTop: 50,
            // imageWidth: 400
          },
          function (asyncResult) {
            if (asyncResult.status === window.Office.AsyncResultStatus.Failed) {
              console.log(asyncResult.error.message);
            }
          }
        )
      })
    },
    loadDoc() {
      // var docUrl = "https://dzxx.njcit.owvlab.net/vlab_files/docs/新能源汽车仿真操作手册.docx";
      var bcode = ""
      window.PowerPoint.createPresentation(bcode);
    },
    loadPPTURL() {
      let bcode;
      function getBase64(imgUrl) {
        let xhr = new XMLHttpRequest();
        xhr.open('get', imgUrl, true);
        // 重点1
        xhr.responseType = 'blob';
        xhr.onload = function () {
          if (this.status == 200) {
            //得到一个blob对象
            let blob = this.response;
            // 重点2
            let oFileReader = new FileReader();
            oFileReader.onloadend = function (e) {
              // 结果
              bcode = e.target.result
              console.log(bcode)
              window.PowerPoint.createPresentation(bcode.split("base64,")[1]);
            };
            // oFileReader.onload = async (event) => {
            //   const startIndex = reader.result.toString().indexOf("base64,");
            //   const copyBase64 = reader.result.toString().substr(startIndex + 7);

            //   chosenFileBase64 = copyBase64;
            // };
            oFileReader.readAsDataURL(blob);
          }
        };
        xhr.onreadystatechange = function () {  //绑定响应状态事件监听函数
          if (xhr.readyState == 4) {  //监听readyState状态
            if (xhr.status == 200 || xhr.status == 0) {  //监听HTTP状态码
              // console.log(xhr.responseText);  //接收数据
              // console.log(base64)
              // window.PowerPoint.createPresentation(base64);
            }
          }
        }
        xhr.send();
      }
      var docUrl = "https://dzxx.njcit.owvlab.net/vlab_files/docs/6.pptx";
      getBase64(docUrl)
      // window.PowerPoint.createPresentation(base64);




    }
  }
}
</script>

